const e={name:"Caroline,",title:"Fondatrice du studio Biopilates : passionnée de mouvement et experte en Pilates",bio:{intro:"Caroline est une <strong>experte en Pilates</strong> et en mouvement avec <strong>plus de 15 ans d'expérience.</strong>",founder:"<strong>Fondatrice du Studio Biopilates</strong>, elle est <strong>spécialisée dans la méthode STOTT PILATES</strong> et propose des entraînements personnalisés pour tous niveaux.",training:"Formée en <strong>Gyrotonic, Evolis</strong> et <strong>Etiopathie</strong>, Caroline s'est également perfectionnée en <strong>biomécanique</strong> pour proposer une approche holistique du mouvement.",passion:"Animée par la passion de la danse, Caroline se consacre aux danseurs et aide les gens à trouver un moyen <strong>sans douleur</strong> de rester en <strong>bonne santé</strong> et <strong>actif</strong>.",quality:"<strong>Son label de qualité Biopilates - Bio de La Biomécanique</strong> est un gage de l'excellence de ses cours et de son engagement à offrir une expérience unique à ses clients."}},t={title:"Des approches uniques : Stott Pilates®, Gyrotonic, Evolis",description:"Biopilates se distingue par son approche unique et personnalisée, combinant différentes techniques pour un bien-être optimal. Découvrez nos trois disciplines phares :",methods:[{title:"STOTT PILATES",description:"Est une méthode d'entraînement précise et efficace pour renforcer le corps et améliorer la posture."},{title:"Gyrotonic",description:"Combine la force du Pilates et la fluidité du Gyrotonic pour améliorer la posture, la flexibilité et le bien-être."},{title:"Evolis",description:"Est une méthode innovante alliant Pilates et équipements évolutifs pour améliorer force, flexibilité et posture."}],action:"Réserver"},s={title:"Biopilates : Un Label de Qualité Unique - Bio de La Biomécanique",description:"Biopilates se distingue par son label de qualité unique, <strong>Bio de La Biomécanique</strong>, qui garantit une pratique du Pilates et du Gyrotonic sûre, efficace et sans douleur. Ce label repose sur trois piliers fondamentaux :",pillars:["Expertise et expérience","Pédagogie innovante","Bien-être et santé"]},i={discoverMethod:"Découvrir notre méthode",noItems:"Aucun élément à afficher"},o={title:"Formation et Cours EVOLIS à Paris - Studio Biopilates",subtitle:"Découvrez les cours et formations <strong>Evolis</strong> à Paris au Studio Biopilates. Une méthode innovante pour améliorer posture, souplesse et bien-être général. Réservez votre séance dès aujourd'hui !",description:"Bienvenue au Studio Biopilates, situé au cœur de Paris, où nous proposons <strong>la méthode Evolis®</strong>, développée par <strong>Jean Frelat</strong>. Cette approche globale de santé repose sur un réflexe proprioceptif et une nouvelle manière de renforcer les muscles.",principles:{title:"Les Principes de la Méthode Evolis® :",list:{0:"<strong>Travail Musculaire Excentrique : </strong>Renforcement des muscles superficiels et profonds sans effort excessif.",1:"<strong>Étirements Actifs et Passifs : </strong>Alternance pour optimiser la contraction musculaire et améliorer la souplesse.",2:"<strong>Synchronisation de la Respiration : </strong>Pour une meilleure coordination et un bien-être général."}},benefits:{title:"Bénéfices et adaptabilité :",description:"<strong>La méthode Evolis®</strong> favorise:",items:{0:"La réorganisation du squelette",1:"Améliore la posture",2:"L'amplitude des mouvements"},conclusion:"Elle est idéale pour tous les âges et niveaux de forme physique."},forWho:{title:"Pour Qui ?",categories:[{title:"Tous publics",description:"Modelage de la silhouette, amélioration du maintien postural et renforcement du périnée."},{title:"Actifs surmenés",description:"Réduction des douleurs dorsales, relaxation <br/> et redynamisation."},{title:"Sédentaires",description:"Soulagement des maux de dos <br>et renforcement musculaire global."},{title:"Seniors",description:"Lutte contre le vieillissement, amélioration de l'équilibre et de la coordination."},{title:"Sportifs",description:"Conditionnement musculaire <br>et récupération physique."},{title:"Adolescents",description:"Prévention pendant la phase de croissance."}]},booking:{title:"Pour découvrir les bienfaits de la méthode Evolis®",description:"Réservez dès maintenant une séance individuelle au Studio Biopilates, situé au 2 rue Boyer, 75020 Paris.",price:"Tarif de la séance : 64€",button:"Réserver un cours"}},n={title:"Formation et Cours GYROTONIC® à Paris - Studio Biopilates",subtitle:"Découvrez les cours et formations <strong>GYROTONIC</strong>® à Paris. Méthode innovante pour améliorer la force, la souplesse et l'équilibre. Rejoignez nous au Studio Biopilates pour des séances adaptées à tous les niveaux.",description:"Bienvenue au Studio Biopilates à Paris, votre centre de référence pour la méthode <strong>GYROTONIC</strong>®. Créée par le danseur hongrois <strong>Julio Horvath</strong>, cette méthode unique combine les principes du yoga, de la gymnastique, de la natation et de la danse pour mobiliser le corps dans sa globalité.",workshops:{title:"Les Ateliers GYROTONIC® et GYROKINESIS® :",gyrokinesis:{title:"GYROKINESIS®",description:"Commencez sur un tabouret et évoluez vers des exercices au sol, visant l'éveil des sens et la mobilisation complète du corps."},gyrotonic:{title:"GYROTONIC®",description:"Utilisez des machines innovantes comme le Pulley Tower et l'Archway pour améliorer la force, la souplesse, la coordination et l'équilibre."}},benefits:{title:"Bénéfices et adaptabilité :",description:"<strong>La méthode GYROTONIC®</strong> est accessible à tous et vise à améliorer le confort musculaire et articulaire. Elle est idéale pour ceux cherchant à augmenter leur :",items:{0:"Endurance musculaire",1:"Flexibilité",2:"Coordination neuromusculaire"}},equipment:{title:"Matériel Utilisé :",description:"Au Studio Biopilates, nous utilisons des équipements spécialisés tels que :",items:{0:"Le banc du Pulley Tower",1:"L'Archway",2:"Le Jumping Stretching Board"}},booking:{title:"Réservez Votre Premier Atelier :",description:"N'attendez plus pour découvrir les secrets de la méthode GYROTONIC® et ses nombreux bienfaits. Réservez dès maintenant et commencez votre transformation.",button:"Réserver un cours"}},r={title:"Formation et Cours STOTT PILATES à Paris - Studio Biopilates",subtitle:"Découvrez les cours et formations <strong>STOTT PILATES</strong> à Paris. Techniques modernes pour rééquilibrer les muscles et restaurer la courbe naturelle du rachis. Rejoignez-nous au Studio Biopilates.",description:"Bienvenue au <strong>Studio Biopilates à Paris</strong>, le premier centre de cours et formation <strong>STOTT PILATES</strong> en France. La méthode <strong>STOTT PILATES</strong>, une approche contemporaine et systématique qui incorpore des pratiques démontrées et reconnues en biomécanique, est conçue pour rééquilibrer les muscles et restaurer la courbe naturelle du rachis.",founders:"<strong>Les Merrithews</strong> ont collaboré avec des physiothérapeutes et des experts en médecine sportive pour réinventer cette méthode d'entraînement. Ils ont développé une approche moderne, exhaustive et systématique, basée sur les principes originaux.",join:"<strong>Rejoignez-nous</strong> pour découvrir les bienfaits de cette méthode innovante.",discover:"Découvrez",principles:{title:"Les cinq principes de base de la méthode Stott Pilates",subtitle:"<strong>La méthode Stott Pilates</strong> se distingue par 5 principes de base et offre de nombreux bénéfices pour le corps et l'esprit",description:"Commencer chaque exercice dans une position neutre et sans tension est crucial pour les principes de base du <strong>STOTT PILATES</strong>. Une bonne position de départ, par exemple allongé sur le dos avec le bassin et la colonne vertébrale en position neutre, nécessite une légère contraction musculaire. Cela permet de maintenir l'alignement idéal du bassin, de la cage thoracique et de la colonne vertébrale, réduisant ainsi les tensions et assurant une posture correcte tout au long de l'exercice.",list:[{title:"Respiration",description:"Une respiration adéquate assure une oxygénation optimale et réduit les tensions musculaires. <strong>Notre technique</strong> vous apprendra à utiliser pleinement votre capacité pulmonaire. Le modèle de respiration utilisé dans la méthode <strong>STOTT PILATES</strong>® aidera à engager vos muscles abdominaux profonds et à stabiliser votre tronc."},{title:"Placement de la Cage Thoracique",description:"Maintenir la bonne position de la cage thoracique est crucial pour l'alignement de la colonne dorsale. <strong>Nos instructeurs</strong> vous guideront pour éviter les erreurs courantes."},{title:"Placement du Bassin",description:"Apprenez à stabiliser votre bassin en position neutre ou imprimée pour une meilleure absorption des chocs et un soutien optimal du dos."},{title:"Stabilité des épaules",description:"Une bonne stabilisation des omoplates évite les tensions dans le cou et les épaules. Découvrez les techniques pour un alignement parfait."},{title:"Placement de la tête et du cou",description:"Gardez une courbe cervicale naturelle et évitez les tensions grâce à nos conseils personnalisés"}]},benefits:{title:"Bénéfices et adaptabilité :",description:"Les exercices <strong>STOTT PILATES</strong> sont adaptables à tous les niveaux et types corporels, que vous soyez débutant ou athlète professionnel. Cette méthode est idéale pour :",items:{0:"Améliorer la posture",1:"Soulager les douleurs dorsales",2:"Augmenter la flexibilité"}}},a={caroline:e,approaches:t,biopilates:s,slider:i,evolis:o,gyrotonic:n,stottpilates:r};export{t as approaches,s as biopilates,e as caroline,a as default,o as evolis,n as gyrotonic,i as slider,r as stottpilates};
